package com;

import java.io.IOException;
import java.io.PrintWriter;

import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;

@WebServlet("/Page2")
public class Page2 extends HttpServlet {
	protected void service(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
		response.setCharacterEncoding("EUC-KR");

		PrintWriter out = response.getWriter();
		
		String ip = request.getRemoteAddr();
		
		if(ip.equals("192.168.0.69")) {
			out.print("<html>");
			out.print("<body>");
			out.print("<h1>병관쌤 반갑습니다.</h1>");
			out.print("<img src=\"http://image.itdonga.com/files/2014/02/19/01_2.jpg\">");
			out.print("</body>");
			out.print("</html>");
		} else if(ip.equals("192.168.0.21")) {
			out.print("<html>");
			out.print("<body>");
			out.print("<h1>"+ "짝꿍" +"친구 반갑다!</h1>");
			out.print("<img src=\"data:image/jpeg;base64,\">");
			out.print("</body>");
			out.print("</html>");
		} else if(ip.equals("192.168.0.13")) {
			out.print("<html>");
			out.print("<body>");
			out.print("<h1>"+ "영윤" +"누나 반갑다!</h1>");
			out.print("<img src=\"data:image/jpeg;base64,\">");
			out.print("</body>");
			out.print("</html>");
		} else {
			out.print("<html>");
			out.print("<body>");
			out.print("<h1>"+ request.getRemoteAddr() +"친구 반갑다!</h1>");
			out.print("<img src=\"data:image/jpeg;base64,\">");
			out.print("</body>");
			out.print("</html>");
		}
	}
}
